import "./Home.css";
import Home from "./Home";
import About from "./About";
import NotFound from "./NotFound";
import {Routes, Route} from "react-router-dom";
function App() {
    return(
        <Routes>
            <Route path="/" element={ Home }></Route>
            <Route path="/about" element={ About }></Route>
            <Route path="/" element={ Home }></Route>
        </Routes>
    )
}

export default App;
